<div>乔震山原名乔大宝，多年前与乔二宝失散，后参加革命，成了著名的红四连的连长。乔二宝在危难之时由李昌毅所救，并留在其身边做了贴身警卫。对长官的感激和愚忠，对兄长的牵挂和思念，让乔二宝左右为难，始终在忠诚和亲情之间无法取舍&hellip;&hellip;&nbsp;</div>
<div>柳繁瑜是国民党抗日名将李昌毅的养女，刚从美国留学回国，在父亲的部队里当军医。在随军撤回城时，因抢救大火中的村民与同在救人的乔震山相遇而被俘。她在与乔震山的接触中，逐渐被我军同志间兄弟情深、热爱百姓的行为所感动，被乔震山的机智与勇敢所吸引&hellip;&hellip;柳繁瑜回到北平城后帮助周国华、乔震山完成了入城侦查的任务，并为李昌毅的最终起义做出了贡献。&nbsp;</div>
